"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[1477],{10:r=>{r.exports=JSON.parse('{"blogPosts":[{"id":"/2023/12/23/Git","metadata":{"permalink":"/blog/2023/12/23/Git","editUrl":"https://github.com/3320753238/3320753238.github.io/blog/2023-12-23-Git.md","source":"@site/blog/2023-12-23-Git.md","title":"Git","description":"- Git \u7248\u672c\u63a7\u5236\u5de5\u5177\uff0c\u5f00\u53d1\u8fc7\u7a0b\u4e2d\u7a0b\u5e8f\u4e0d\u662f\u4e00\u6b21\u5c31\u5199\u597d\u7684\uff0c\u4ee3\u7801\u662f\u5728\u4e0d\u65ad\u7684\u66f4\u65b0\u8fed\u4ee3\u7684\uff0c\u8fd9\u65f6\u5019\u6211\u4eec\u7a0b\u5e8f\u5458\u5f00\u53d1\u8f6f\u4ef6\u65f6\u5c31\u9700\u8981\u4e00\u4e2a\u8fd9\u6837\u7684\u5de5\u5177\u5bf9\u4ee3\u7801\u8fdb\u884c\u7ba1\u7406","date":"2023-12-23T00:00:00.000Z","formattedDate":"2023\u5e7412\u670823\u65e5","tags":[{"label":"git","permalink":"/blog/tags/git"},{"label":"github","permalink":"/blog/tags/github"},{"label":"gitee","permalink":"/blog/tags/gitee"}],"readingTime":10.355,"hasTruncateMarker":false,"authors":[{"name":"An","title":"\u535a\u5ba2\u4f5c\u8005","url":"https://github.com/facebook/docusaurus","image_url":"https://s11.ax1x.com/2023/12/23/pi7fqTe.jpg","imageURL":"https://s11.ax1x.com/2023/12/23/pi7fqTe.jpg"}],"frontMatter":{"title":"Git","authors":{"name":"An","title":"\u535a\u5ba2\u4f5c\u8005","url":"https://github.com/facebook/docusaurus","image_url":"https://s11.ax1x.com/2023/12/23/pi7fqTe.jpg","imageURL":"https://s11.ax1x.com/2023/12/23/pi7fqTe.jpg"},"tags":["git","github","gitee"]},"unlisted":false,"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"- Git \u7248\u672c\u63a7\u5236\u5de5\u5177\uff0c\u5f00\u53d1\u8fc7\u7a0b\u4e2d\u7a0b\u5e8f\u4e0d\u662f\u4e00\u6b21\u5c31\u5199\u597d\u7684\uff0c\u4ee3\u7801\u662f\u5728\u4e0d\u65ad\u7684\u66f4\u65b0\u8fed\u4ee3\u7684\uff0c\u8fd9\u65f6\u5019\u6211\u4eec\u7a0b\u5e8f\u5458\u5f00\u53d1\u8f6f\u4ef6\u65f6\u5c31\u9700\u8981\u4e00\u4e2a\u8fd9\u6837\u7684\u5de5\u5177\u5bf9\u4ee3\u7801\u8fdb\u884c\u7ba1\u7406\\r\\n\\r\\n- \u4e00\u4e2a\u9879\u76ee\u4e0d\u4f1a\u53ea\u6709\u4e00\u4e2a\u4eba\u8fdb\u884c\u7ef4\u62a4\uff0c\u800c\u662f\u5f88\u591a\u4eba\u5bf9\u4e00\u6bb5\u4ee3\u7801\u8fdb\u884c\u7ef4\u62a4\u7f16\u5199\\r\\n- \u5728\u6e38\u620f\u4e2d\u6211\u4eec\u90fd\u6709\u5b58\u6863\u548c\u56de\u6863\u7684\u529f\u80fd \u800c `Git` \u5c31\u662f\u5145\u5f53\u56de\u6863\u548c\u5b58\u6863\u529f\u80fd\u7684\u5de5\u5177\\r\\n- stem++ \u52a0\u901f `github`\u8bbf\u95ee\u901f\u5ea6\u7684\u8f6f\u4ef6 https://steampp.net/\\r\\n\\r\\n\\r\\n\\r\\n### \u914d\u7f6e\\r\\n\\r\\nname\\r\\n\\r\\n> `git config --global user.name \\"An\\"`\\r\\n\\r\\nemail\\r\\n\\r\\n> `git config --global user.email \\"3320753238@qq.com\\"`\\r\\n\\r\\n### \u4f7f\u7528 Git\\r\\n\\r\\n- `git status` \u67e5\u770b\u4ed3\u5e93\u7684\u72b6\u6001\\r\\n\\r\\n- `git init` \u521d\u59cb\u5316\u4ed3\u5e93\\r\\n\\r\\n  ```bash\\r\\n  ## git status \u4e4b\u540e \u51fa\u73b0\u8fd9\u4e2a\u8868\u793a\u4ed3\u5e93\u5df2\u7ecf\u521d\u59cb\u5316\u5b8c\u6bd5\\r\\n  On branch master\\r\\n  \\r\\n  No commits yet\\r\\n  \\r\\n  nothing to commit (create/copy files and use \\"git add\\" to track)\\r\\n  ```\\r\\n\\r\\n- \u521a\u6dfb\u52a0\u5230\u9879\u76ee\u4e2d\u7684\u6587\u4ef6\u662f\u672a\u8ddf\u8e2a\u6587\u4ef6\\r\\n\\r\\n  ```bash\\r\\n  ## \u672a\u8ddf\u8e2a\\r\\n  Untracked files:\\r\\n    (use \\"git add <file>...\\" to include in what will be committed)\\r\\n          01.text\\r\\n  ```\\r\\n\\r\\n- `git add ./01.txt`  \u5c06\u6587\u4ef6\u5207\u6362\u5230\u6682\u5b58\u72b6\u6001\\r\\n\\r\\n- `git add *` \u5c06\u6240\u6709\u5df2\u4fee\u6539\uff08\u672a\u8ddf\u8e2a\uff09\u7684\u6587\u4ef6\u6682\u5b58\\r\\n\\r\\n  ```bash\\r\\n  ## \u672a\u8ddf\u8e2a --\x3e \u6682\u5b58\\r\\n  On branch master\\r\\n  Changes to be committed:\\r\\n    (use \\"git restore --staged <file>...\\" to unstage)\\r\\n          new file:   01.txt\\r\\n  ```\\r\\n\\r\\n- `git commit -m \\"XXX\\"` \u5c06\u6682\u5b58\u7684\u6587\u4ef6\u5b58\u50a8\u5230\u4ed3\u5e93\u4e2d\\r\\n\\r\\n  ```bash\\r\\n  ## \u6682\u5b58 --\x3e \u672a\u4fee\u6539\\r\\n  [master (root-commit) 82090d3] \u7b2c\u4e00\u6b21\u63d0\u4ea4 01.txt\\r\\n   1 file changed, 1 insertion(+)\\r\\n   create mode 100644 01.txt\\r\\n  ```\\r\\n\\r\\n- `\u672a\u4fee\u6539 --\x3e \u4fee\u6539`\\r\\n\\r\\n  ```bash\\r\\n  ## \u4fee\u6539\u4ee3\u7801\u540e \u6587\u4ef6\u4f1a\u53d8\u672a\u4fee\u6539\u72b6\u6001\\r\\n  On branch master\\r\\n  Changes not staged for commit:\\r\\n    (use \\"git add/rm <file>...\\" to update what will be committed)        \\r\\n    (use \\"git restore <file>...\\" to discard changes in working directory)\\r\\n          modified:   01.txt\\r\\n  ```\\r\\n\\r\\n- `git log` \u67e5\u770b\u4fee\u6539\u65e5\u5fd7\\r\\n\\r\\n- `git commit -a -m \\"xxxx\\"` \u5c06\u6240\u6709\u6587\u4ef6\u90fd\u8bbe\u4e3a\u6682\u5b58\u7136\u540e\u518d\u63d0\u4ea4\uff0c\u672a\u8ddf\u8e2a\u7684\u6587\u4ef6\u4e0d\u4f1a\u63d0\u4ea4\\r\\n\\r\\n\\r\\n\\r\\n### \u5e38\u7528\u547d\u4ee4\\r\\n\\r\\n1. \u91cd\u7f6e\u6587\u4ef6\\r\\n\\r\\n```bash\\r\\ngit restore <filename> ## \u6062\u590d\u6587\u4ef6\\r\\ngit restore --staged <filename> ## \u53d6\u6d88\u6682\u5b58\u72b6\u6001\\r\\n```\\r\\n\\r\\n2. \u5220\u9664\u6587\u4ef6\\r\\n\\r\\n```bash\\r\\ngit rm <filename> ## \u5220\u9664\u6587\u4ef6\\r\\ngit rm <filename> -f ## \u5f3a\u5236\u5220\u9664\\r\\n```\\r\\n\\r\\n3. \u79fb\u52a8\u6587\u4ef6\\r\\n\\r\\n```bash\\r\\ngit mv from to #\u79fb\u52a8\u6587\u4ef6 \u91cd\u547d\u540d\u6587\u4ef6\\r\\n```\\r\\n\\r\\n\\r\\n\\r\\n### \u5206\u652f\\r\\n\\r\\n`git` \u5b58\u50a8\u6587\u4ef6\u65f6\uff0c\u6bcf\u4e00\u6b21\u4ee3\u7801\u63d0\u4ea4\u90fd\u4f1a\u521b\u5efa\u4e00\u4e2a\u4e0e\u4e4b\u5bf9\u5e94\u7684\u8282\u70b9\uff0c`git` \u5c31\u662f\u901a\u8fc7\u4e00\u4e2a\u4e00\u4e2a\u7684\u8282\u70b9\u6765\u8bb0\u5f55\u4ee3\u7801\u7684\u72b6\u6001\u3002\u8282\u70b9\u4f1a\u6784\u6210\u4e00\u4e2a\u6811\u72b6\u7ed3\u6784\uff0c\u6811\u72b6\u7ed3\u6784\u5c31\u610f\u5473\u7740\uff0c\u8fd9\u4e2a\u6811\u5c31\u4f1a\u5b58\u5728\u5206\u652f\uff0c\u9ed8\u8ba4\u60c5\u51b5\u4e0b\u4ed3\u5e93\u53ea\u4f1a\u6709\u4e00\u4e2a\u5206\u652f\u547d\u540d\u4e3a `master`\\r\\n\\r\\n\u5728\u4f7f\u7528 `git`\u65f6\u6211\u4eec\u53ef\u4ee5\u521b\u5efa\u591a\u4e2a\u5206\u652f\uff0c\u5206\u652f\u4e0e\u5206\u652f\u4e4b\u95f4\u76f8\u4e92\u72ec\u7acb\uff0c\u5728\u4e00\u4e2a\u5206\u652f\u4e0a\u4fee\u6539\u4ee3\u7801\u65f6\u4e0d\u4f1a\u5f71\u54cd\u5176\u4ed6\u7684\u5206\u652f\u3002\\r\\n\\r\\n```bash\\r\\ngit branch ## \u67e5\u770b\u5206\u652f\\r\\ngit branch <branch name> ## \u521b\u5efa\u5206\u652f \\r\\ngit branch -d <branch name> ## \u5220\u9664\u5206\u652f\\r\\n\\r\\ngit switch <branch name> ## \u5207\u6362\u5206\u652f\\r\\ngit switch -c <branch name> ## \u521b\u5efa\u5e76\u5207\u6362\u5206\u652f\\r\\n\\r\\ngit merge <branch name> ## \u5408\u5e76\u5206\u652f\\r\\n```\\r\\n\\r\\n\u5728\u5f00\u53d1\u4e2d\u90fd\u662f\u5728\u81ea\u5df1\u7684\u5206\u652f\u4e0a\u7f16\u5199\u4ee3\u7801\uff0c\u4ee3\u7801\u7f16\u5199\u5b8c\u6bd5\u540e\uff0c\u518d\u5c06\u81ea\u5df1\u7684\u5206\u652f\u5408\u5e76\u5230\u4e3b\u5206\u652f\u4e2d\\r\\n\\r\\n### \u53d8\u57fa\uff08`rebase`\uff09\\r\\n\\r\\n\u5728\u5f00\u53d1\u4e2d\u9664\u4e86\u901a\u8fc7 `merage`\u6765\u5408\u5e76\u5206\u652f\u5916\uff0c\u8fd8\u53ef\u4ee5\u901a\u8fc7\u53d8\u57fa\u6765\u5b8c\u6210\u5206\u652f \u7684\u5408\u5e76\u3002\\r\\n\\r\\n\u901a\u8fc7 `merge`\u5408\u5e76\u5206\u652f\u65f6\uff0c\u5728\u63d0\u4ea4\u8bb0\u5f55\u4e2d\u4f1a\u5c06\u6240\u6709\u7684\u5206\u652f\u521b\u5efa\u548c\u5206\u652f\u5408\u5e76\u7684\u8fc7\u7a0b\u5168\u90e8\u663e\u793a\u51fa\u6765\uff0c\u8fd9\u6837\u5f53\u9879\u76ee\u6bd4\u8f83\u590d\u6742\uff0c\u5f00\u53d1\u8fc7\u7a0b\u6bd4\u8f83\u6ce2\u6298\u65f6\uff0c\u6211\u4eec\u5fc5\u987b\u8981\u53cd\u590d\u7684\u521b\u5efa\u3001\u5408\u5e76\u3001\u5220\u9664\u5206\u652f\u3002\\r\\n\\r\\n\u8fd9\u6837\u4e00\u6765\u5c06\u4f1a\u4f7f\u5f97\u4ee3\u7801\u7684\u63d0\u4ea4\u8bb0\u5f55\u53d8\u7684\u6781\u4e3a\u6df7\u4e71\u3002\\r\\n\\r\\n\u539f\u7406\uff08\u53d8\u57fa\u65f6\u53d1\u751f\u4e86\u4ec0\u4e48\uff09\uff1a\\r\\n\\r\\n1. \u5f53\u6211\u4eec\u53d1\u8d77\u53d8\u57fa\uff0c`git`\u4f1a\u627e\u5230\u4e24\u6761\u5206\u652f\u6700\u8fd1\u7684\u5171\u540c\u7956\u5148 \\r\\n2. \u5bf9\u6bd4\u5f53\u524d\u5206\u652f\u76f8\u5bf9\u4e8e\u7956\u5148\u7684\u5386\u53f2\u63d0\u4ea4\uff0c\u5e76\u4e14\u5c06\u4ed6\u4eec\u63d0\u53d6\u51fa\u6765\u5b58\u50a8\u5230\u4e00\u4e2a\u4e34\u65f6\u6587\u4ef6\u4e2d\\r\\n3. \u5c06\u5f53\u524d\u90e8\u5206\u6307\u5411\u76ee\u6807\u7684\u57fa\u5e95\\r\\n4. \u4ee5\u5f53\u524d\u57fa\u5730\u5f00\u59cb\uff0c\u91cd\u65b0\u6267\u884c\u5386\u53f2\u64cd\u4f5c\\r\\n\\r\\n`\u53d8\u57fa`\u548c `merge`  \u5bf9\u4e8e\u5408\u5e76\u5206\u652f\u6765\u8bf4\u6700\u7ec8\u7684\u7ed3\u679c\u662f\u4e00\u6837\u7684\uff01\u4f46\u662f`\u53d8\u57fa`\u4f1a\u4f7f\u5f97\u6211\u4eec\u7684\u4ee3\u7801\u63d0\u4ea4\u8bb0\u5f55\u66f4\u6574\u6d01\u66f4\u6e05\u6670\uff01\u6ce8\u610f\u5927\u90e8\u5206\u60c5\u51b5\u4e0b\u5408\u5e76\u548c `\u53d8\u57fa` \u662f\u53ef\u4ee5\u4e92\u6362\u7684\uff0c\u4f46\u662f\u5982\u679c\u5206\u652f\u5df2\u7ecf\u63d0\u4ea4\u8fdc\u7a0b\u4ed3\u5e93\uff0c\u90a3\u4e48\u5c3d\u91cf\u4e0d\u8981\u4f7f\u7528 `\u53d8\u57fa`\\r\\n\\r\\n```bash\\r\\ngit rebase <branch name> # \u53d8\u57fa\\r\\n```\\r\\n\\r\\n### \u8fdc\u7a0b\u4ed3\u5e93\uff08`remote`\uff09\\r\\n\\r\\n\u76ee\u524d\u6211\u4eec\u5bf9\u4e8e `git` \u6240\u6709\u64cd\u4f5c\u90fd\u662f\u5728\u672c\u5730\u8fdb\u884c\u7684\u3002\u4f46\u662f\u5728\u5f00\u53d1\u4e2d\u663e\u7136\u4e0d\u662f\u8fd9\u6837\u7684\uff0c\u8fd9\u65f6\u5019\u6211\u4eec\u5c31\u9700\u8981\u4e00\u4e2a\u8fdc\u7a0b\u7684 `git` \u4ed3\u5e93\u3002\\r\\n\\r\\n\u8fdc\u7a0b\u7684 `git` \u4ed3\u5e93\u548c\u672c\u5730\u7684\u4ed3\u5e93\u6ca1\u6709\u672c\u8d28\u7684\u533a\u522b\uff0c\u4e0d\u540c\u70b9\u662f\u5728\u4e8e\u8fdc\u7a0b\u7684\u4ed3\u5e93\u53ef\u4ee5\u88ab\u591a\u4eba\u540c\u65f6\u8bbf\u95ee\u4f7f\u7528\uff0c\u65b9\u4fbf\u591a\u4eba\u534f\u4f5c\u5f00\u53d1\u3002\u5728\u5b9e\u9645\u5de5\u4f5c\u4e2d\uff0c`git` \u7684\u670d\u52a1\u5668\u901a\u5e38\u7531\u516c\u53f8\u642d\u5efa\u5185\u90e8\u4f7f\u7528\u6216\u662f\u8d2d\u4e70\u4e00\u4e9b\u516c\u5171\u7684\u7684\u79c1\u6709 `git` \u670d\u52a1\u5668\u3002\u5b66\u4e60\u9636\u6bb5\uff0c\u76f4\u63a5\u4f7f\u7528\u4e00\u4e9b\u5f00\u653e\u7684\u516c\u5171\u7684 `git` \u4ed3\u5e93\u3002\\r\\n\\r\\n\u76ee\u524d\u5e38\u7528\u7684\u5e93\u6709\u4e24\u4e2a\uff1a`GitHub` \u548c `Gitee` \\r\\n\\r\\n\u5c06\u672c\u5730\u5e93\u4e0a\u4f20\u5230 `GitHub`\\r\\n\\r\\n```bash\\r\\n# git remote add <remote name> <url>\\r\\ngit remote add origin https://github.com/3320753238/git-demo.git\\r\\n\\r\\n# \u4fee\u6539\u5206\u652f\u7684\u540d\u5b57\u4e3a main\\r\\ngit branch -M main\\r\\n\\r\\n# git push \u5c06\u4ee3\u7801\u4e0a\u4f20\u81f4\u670d\u52a1\u5668\\r\\ngit push -u origin main\\r\\n```\\r\\n\\r\\n\u5c06\u672c\u5730\u5e93\u4e0a\u4f20 `Gitee`\\r\\n\\r\\n```bash\\r\\ngit remote add gitee https://gitee.com/arj12345/git-demo.git\\r\\ngit push -u gitee main\\r\\n```\\r\\n\\r\\n### \u8fdc\u7a0b\u5e93\u7684\u64cd\u4f5c\u7684\u547d\u4ee4\\r\\n\\r\\n```bash\\r\\ngit remote # \u5217\u51fa\u5f53\u524d\u5173\u8054\u7684\u8fdc\u7a0b\u5e93\\r\\ngit remote add <\u8fdc\u7a0b\u5e93\u540d> <url> # \u5173\u8054\u8fdc\u7a0b\u4ed3\u5e93\\r\\ngit remote remove <\u8fdc\u7a0b\u5e93\u540d> # \u5207\u65ad\u8fdc\u7a0b\u5173\u8054\u7684\u4ed3\u5e93\\r\\ngit push -u <\u8fdc\u7a0b\u5e93\u540d> <\u5206\u652f\u540d> # \u5411\u8fdc\u7a0b\u4ed3\u5e93\u6258\u9001\u4ee3\u7801\uff0c\u5e76\u548c\u5f53\u524d\u5206\u652f\u5173\u8054\\r\\ngit push <\u8fdc\u7a0b\u5e93\u540d> <\u672c\u5730\u5206\u652f\u540d>:<\u8fdc\u7a0b\u5206\u652f>\\r\\ngit clone <url> # \u4ece\u8fdc\u7a0b\u5e93\u4e0b\u8f7d\u4ee3\u7801\\r\\n\\r\\ngit push   # \u5982\u679c\u672c\u5730\u5e93\u7684\u7248\u672c\u4f4e\u4e8e\u8fdc\u7a0b\u5e93 push \u9ed8\u8ba4\u63a8\u9001\u4e0d\u4e0a\u53bb\\r\\ngit fetch  # \u8981\u60f3\u63a8\u9001\u6210\u529f\uff0c\u5fc5\u987b\u5148\u786e\u4fdd\u672c\u5730\u5e93\u548c\u8fdc\u7a0b\u5e93\u7684\u7248\u672c\u4e00\u81f4\uff0cfetch \u5b83\u4f1a\u4ece\u8fdc\u7a0b\u5e93\u4e0b\u8f7d\u6240\u6709\u4ee3\u7801\uff0c\u4f46\u662f\u5b83\u4e0d\u4f1a\u5c06\u4ee3\u7801\u548c\u5f53\u524d\u5206\u652f\u81ea\u52a8\u5408\u5e76\\r\\n\\t\\t   # \u4f7f\u7528fetch \u62c9\u53d6\u4ee3\u7801\uff0c\u5fc5\u987b\u8981\u624b\u52a8\u5bf9\u4ee3\u7801\u8fdb\u884c\u5408\u5e76\\r\\n\\r\\ngit pull   # \u670d\u52a1\u5668\u62c9\u53d6\u4ee3\u7801\u5e76\u5408\u5e76\\r\\n```\\r\\n\\r\\n\u6ce8\u610f\uff1a\u63a8\u52a8\u4ee3\u7801\u524d\uff0c\u4e00\u5b9a\u8981\u5728\u8fdc\u7a0b\u5e93\u4e2d\u62c9\u53d6\u65b0\u7684\u4ee3\u7801\\r\\n\\r\\n### tag \u6807\u7b7e\\r\\n\\r\\n\u5f53\u5934\u6307\u9488\u6ca1\u6709\u6307\u5411\u5206\u652f\u7684\u5934\u90e8\u65f6\uff0c\u8fd9\u79cd\u72b6\u6001\u6211\u4eec\u79f0\u4e3a\u5206\u79bb\u5934\u6307\u9488\uff08`HEAD detached`\uff09\u5728\u5206\u79bb\u5934\u6307\u9488\u7684\u72b6\u6001\u4e0b\u4e5f\u53ef\u4ee5\u64cd\u4f5c\u4ee3\u7801\uff0c\u4f46\u662f\u8fd9\u79cd\u72b6\u6001\u4e0b\u8fdb\u884c\u64cd\u4f5c\u4e0d\u4f1a\u51fa\u73b0\u5728\u4efb\u4f55\u5206\u652f\u4e0a\uff08**\u6240\u4ee5\u4e0d\u8981\u5728\u5206\u79bb\u5934\u6307\u9488\u7684\u72b6\u6001\u4e0b\u64cd\u4f5c\u4ee3\u7801\u4ed3**\uff09\\r\\n\\r\\n\u5982\u679c\u4e00\u5b9a\u8981\u56de\u5230\u540e\u8fb9\u7684\u8282\u70b9\u8fdb\u884c\u64cd\u4f5c\uff0c\u5219\u53ef\u4ee5\u9009\u5728\u521b\u5efa\u5206\u652f\u540e\u518d\u64cd\u4f5c\\r\\n\\r\\n```bash\\r\\ngit switch -c <\u5206\u652f\u540d> <\u63d0\u4ea4\u7684\u8282\u70b9id>\\r\\n```\\r\\n\\r\\n\u6807\u7b7e\uff1a\u53ef\u4ee5\u4e3a\u63d0\u4ea4\u8bb0\u5f55\u8bbe\u7f6e\u6807\u7b7e\uff0c\u8bbe\u7f6e\u6807\u7b7e\u4ee5\u540e\u53ef\u4ee5\u901a\u8fc7\u6807\u7b7e\u5feb\u901f\u7684\u8bc6\u522b\u5f00\u53d1\u8282\u70b9\\r\\n\\r\\n```bash\\r\\ngit tag\\r\\ngit tag \u7248\u672c\\r\\ngit tag \u7248\u672c \u63d0\u4ea4id\\r\\n\\r\\n# \u63a8\u9001\u6807\u7b7e\u5230\u8fdc\u7a0b\\r\\ngit push \u8fdc\u7a0b\u4ed3\u5e93 \u6807\u7b7e\u540d\\r\\ngit push \u8fdc\u7a0b\u4ed3\u5e93 -tags # \u63a8\u9001\u6240\u6709\\r\\n# \u5220\u9664\u6807\u7b7e\\r\\ngit tag -d \u6807\u7b7e\u540d # \u5220\u9664\u6807\u7b7e\\r\\ngit push \u8fdc\u7a0b\u4ed3\u5e93 --delete \u6807\u7b7e\u540d # \u5220\u9664\u8fdc\u7a0b\u6807\u7b7e\\r\\n```\\r\\n\\r\\n### `gitignore`\\r\\n\\r\\n\u9ed8\u8ba4\u60c5\u51b5\u4e0b\uff0c`git`\u4f1a\u76d1\u89c6\u9879\u76ee\u4e2d\u6240\u6709\u5185\u5bb9\uff0c\u4f46\u662f\u6709\u4e9b\u5185\u5bb9\u6bd4\u5982 `node_modules`\u76ee\u5f55\u4e2d\u7684\u5185\u5bb9\u6211\u4eec\u4e0d\u5e0c\u671b\u5b83\u53d7 `git` \u7ba1\u7406\u3002\\r\\n\\r\\n\u6211\u4eec\u53ef\u4ee5\u518d\u9879\u76ee\u76ee\u5f55\u4e2d\u6dfb\u52a0\u4e00\u4e2a `.gitignore`\u6587\u4ef6\u8bbe\u7f6e`git`\u5ffd\u7565\u7684\u5185\u5bb9\\r\\n\\r\\n```gitignore\\r\\nnode_modules\\r\\nyarn.lock\\r\\n# \u901a\u914d\u6240\u6709 .log \u6269\u5c55\u540d\u7684\u6587\u4ef6\\r\\n*.log\\r\\n```\\r\\n\\r\\n### `github`\u7684\u9759\u6001\u754c\u9762\\r\\n\\r\\n\u5728 `github`\u4e2d\uff0c\u53ef\u4ee5\u5c06\u81ea\u5df1\u7684\u9759\u6001\u9875\u9762\u76f4\u63a5\u90e8\u7f72\u5230 `github`\u4e0a\uff0c\u5b83\u4f1a\u63d0\u4f9b\u4e00\u4e2a\u5730\u5740\uff0c\u4f7f\u5f97\u6211\u4eec\u7684\u7f51\u9875\u53ef\u4ee5\u5728\u4e92\u8054\u7f51\u4e0a\u8bbf\u95ee\\r\\n\\r\\n\u8981\u6c42\uff1a\\r\\n\\r\\n\\t- \u9759\u6001\u9875\u9762\u7684\u5206\u652f\u5fc5\u987b\u53eb\uff1a`gh-pages`\\r\\n\\t- \u5982\u679c\u5e0c\u671b\u9875\u9762\u53ef\u4ee5\u901a\u8fc7 `xxxxx.github.io` \u8bbf\u95ee\u5219\u9700\u8981\u5c06\u5e93\u7684\u540d\u5b57\u914d\u7f6e\u4e3a `xxxx.github.io`\\r\\n\\r\\n## `Docusaurus`\\r\\n\\r\\nhttps://docusaurus.io/\\r\\n\\r\\n`facebook `\u63a8\u51fa\u7684\u5f00\u6e90\u7684\u9759\u6001\u7684\u5185\u5bb9\u7ba1\u7406\u7cfb\u7edf\uff0c\u901a\u8fc7\u5b83\u53ef\u4ee5\u5feb\u901f\u90e8\u7f72\u4e00\u4e2a\u9759\u6001\u7f51\u7ad9\\r\\n\\r\\n\u4f7f\u7528\uff1a\\r\\n\\r\\n - \u5b89\u88c5\\r\\n\\r\\n   ```bash\\r\\n   npx create-docusaurus@latest my-website classic\\r\\n   ```\\r\\n\\r\\n - \u542f\u52a8\\r\\n\\r\\n   ```bash\\r\\n   yarn start |  npm start\\r\\n   ```\\r\\n\\r\\n - \u6784\u5efa\u9879\u76ee\\r\\n\\r\\n   ```bash\\r\\n   npm run build | yarn build\\r\\n   ```\\r\\n\\r\\n - \u914d\u7f6e\u9879\u76ee\\r\\n\\r\\n   `docusaurus.config.js` \u9879\u76ee\u7684\u914d\u7f6e\u6587\u4ef6\\r\\n\\r\\n - \u6dfb\u52a0\u9875\u9762\uff1a\\r\\n\\r\\n   \u5728 `docusaurus` \u6846\u67b6\u4e2d\uff0c\u9875\u9762\u5206\u6210\u4e09\u79cd: `page`\u3001`blog`\u3001`doc`"},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/3320753238/3320753238.github.io/blog/2021-08-26-welcome/index.md","source":"@site/blog/2021-08-26-welcome/index.md","title":"Welcome","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2021-08-26T00:00:00.000Z","formattedDate":"2021\u5e748\u670826\u65e5","tags":[{"label":"facebook","permalink":"/blog/tags/facebook"},{"label":"hello","permalink":"/blog/tags/hello"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.405,"hasTruncateMarker":false,"authors":[{"name":"S\xe9bastien Lorber","title":"Docusaurus maintainer","url":"https://sebastienlorber.com","imageURL":"https://github.com/slorber.png","key":"slorber"},{"name":"Yangshun Tay","title":"Front End Engineer @ Facebook","url":"https://github.com/yangshun","imageURL":"https://github.com/yangshun.png","key":"yangshun"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["slorber","yangshun"],"tags":["facebook","hello","docusaurus"]},"unlisted":false,"prevItem":{"title":"Git","permalink":"/blog/2023/12/23/Git"},"nextItem":{"title":"MDX Blog Post","permalink":"/blog/mdx-blog-post"}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."},{"id":"mdx-blog-post","metadata":{"permalink":"/blog/mdx-blog-post","editUrl":"https://github.com/3320753238/3320753238.github.io/blog/2021-08-01-mdx-blog-post.mdx","source":"@site/blog/2021-08-01-mdx-blog-post.mdx","title":"MDX Blog Post","description":"Blog posts support Docusaurus Markdown features, such as MDX.","date":"2021-08-01T00:00:00.000Z","formattedDate":"2021\u5e748\u67081\u65e5","tags":[{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.175,"hasTruncateMarker":false,"authors":[{"name":"S\xe9bastien Lorber","title":"Docusaurus maintainer","url":"https://sebastienlorber.com","imageURL":"https://github.com/slorber.png","key":"slorber"}],"frontMatter":{"slug":"mdx-blog-post","title":"MDX Blog Post","authors":["slorber"],"tags":["docusaurus"]},"unlisted":false,"prevItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"Blog posts support [Docusaurus Markdown features](https://docusaurus.io/docs/markdown-features), such as [MDX](https://mdxjs.com/).\\n\\n:::tip\\n\\nUse the power of React to create interactive blog posts.\\n\\n```js\\n<button onClick={() => alert(\'button clicked!\')}>Click me!</button>\\n```\\n\\n<button onClick={() => alert(\'button clicked!\')}>Click me!</button>\\n\\n:::"}]}')}}]);